import styled from "styled-components";

export const Section = styled.article`
  width: 48%;
  margin-bottom: 40px;
  border: 1px solid white;
  text-align:center
`;
export const Title = styled.article`
  background-color:white;
  color:black;
  padding:30px 0;
`;
